import React from "react";
import {
    BrowserRouter as Router,
    Redirect,
    Route,
    Switch,
} from "react-router-dom";
import Login from "./pages/Login";
import "./App.css"

export default function () {
    return(
        <Router>
            <Switch>
                <Route path={'/login'} exact component={Login}/>
            </Switch>
        </Router>
    );
}
